control.onControlLoad:
g5.name = ""; //当前选择的用户名字
g5.address = ""; //当前用户的地址
g5.customerId = "0"; //当前用户Id

g5.table2Click = function(sender, text) {
    var c;
    for (var i = 0; i < 7; i++) {
        c = ee.getTableCell(ee.getControl("tablebody2"), 0, i);
        c.style.backgroundColor = "";
        c = ee.getTableCell(ee.getControl("tablebody2"), 1, i);
        c.style.backgroundColor = "";
        c = ee.getTableCell(ee.getControl("tablebody2"), 2, i);
        c.style.backgroundColor = "";
    }
    c = ee.getTableCell(ee.getControl("tablebody2"), 0, sender.rowIndex);
    c.style.backgroundColor = "#f0f0ff";
    c = ee.getTableCell(ee.getControl("tablebody2"), 1, sender.rowIndex);
    c.style.backgroundColor = "#f0f0ff";
    c = ee.getTableCell(ee.getControl("tablebody2"), 2, sender.rowIndex);
    c.style.backgroundColor = "#f0f0ff";
    g5.name = g5.task2.getData(2, sender.rowIndex);
    g5.address = g5.task2.getData(3, sender.rowIndex);
    g5.customerId = g5.task2.getData(1, sender.rowIndex); 

    if (g5.name == "") return;
    ee.setText(ee.getControl("panel44"), g5.name);
    ee.setText(ee.getControl("panel26"), g5.address);
    ee.setText(ee.getControl("panel20"), g5.customerId);
    ee.setVisible(ee.getControl("panel35"), false);
    getDetail(); 
}

control.onPageCreate:
var tableToExcel = function(tableData, name) {
    var uri = "data:application/vnd.ms-excel;base64,",
        template = '<html xmlns:o="urn:schemas-microsoft-com:office:office" xmlns:x="urn:schemas-microsoft-com:office:excel" xmlns="http://www.w3.org/TR/REC-html40"><head><!--[if gte mso 9]><xml><x:ExcelWorkbook><x:ExcelWorksheets><x:ExcelWorksheet><x:Name>{worksheet}</x:Name><x:WorksheetOptions><x:DisplayGridlines/></x:WorksheetOptions></x:ExcelWorksheet></x:ExcelWorksheets></x:ExcelWorkbook></xml><![endif]--></head><body><table>{table}</table></body></html>',
        base64 = function(s) { return window.btoa(unescape(encodeURIComponent(s))) },
        format = function(s, c) { return s.replace(/{(\w+)}/g, function(m, p) { return c[p]; }) }
    //if (!table.nodeType) table = document.getElementById(table)
    var ctx = {worksheet: name || "Worksheet", table: tableData}
    window.location.href = uri + base64(format(template, ctx))
}

