taskSetItem.script2:
var searchStr = eio.readString8();

var sql,sqlResult;
if (searchStr != "") {
    searchStr = " where (customer_name like '%" + db.encode(searchStr) + "%') " +
        " or (customer_address like '%" + db.encode(searchStr) + "%') " +
        " or (customer_reference like '%" + db.encode(searchStr) + "%') ";
}
sql =
     "select cast(c_date as char(20)) as c_date, customer_name, " +
     "   cast(customer_address as char(100)) as customer_address,customer_reference from customers " + searchStr;
//es.logWarning(sql);

sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}

eio.appendString8("T");
eio.appendDataSet(sqlResult,"c_date,customer_reference,customer_name,customer_address",0,100);

