taskSetItem.script2:
var name = eio.readString8();
var t1 = eio.readString8();
var t2 = eio.readString8();

var sql,sqlResult;
var token = eio.readString8();
var condition = "";
if (name!="") {
    condition += "and A.customer_name like '%" + db.encode(name) + "%' ";
}
if (t1!="") {
    condition += "and trim(mid(A.c_date,1,10)) >= '" + db.encode(t1) + "' ";
}
if (t2!="") {
    condition += "and trim(mid(A.c_date,1,10)) <= '" + db.encode(t2) + "' "; 
}
sql = 
    "delete from Plan_temp; " +
    "delete from count_temp; " +

    "insert into `Plan_temp` (customer_name,address,operation_id,gas_name,count,c_date) " +
    "select A.customer_name ,A.address,A.operation_id,C.gas_name,count(cp_id),mid(A.c_date,1,10) " +
    "from cylinder_plan A,cylinders B,gases C " +
    "where B.gas_id = C.gas_id " +
    "and   A.cylinder_id = B.cylinder_reference " +
    condition +
    "group by mid(A.c_date,1,10),C.gas_name,A.operation_id; " +

    "insert into `count_temp`(c_date,gas_name,ship_count) " +
    " select c_date ,gas_name ,sum(count) " +
    " from Plan_temp  where operation_id = '12' group by gas_name,operation_id; " +                                

    "update  count_temp  set retrun_count = (select sum(count) " + 
    "                      from Plan_temp  where operation_id = '13' group by gas_name,operation_id ); " +                                

    "update  count_temp  set confirm_count = " +
    " (select sum(count) " +
    " from Plan_temp  where operation_id = '14' group by gas_name,operation_id); " +                                

    "insert into `count_temp`(c_date,gas_name,reject_count) " +
    " select c_date ,gas_name ,sum(count) " +
    " from Plan_temp  where operation_id = '15' group by gas_name,operation_id; " +

    "SELECT *,'0' as n1, '0' as n2 from count_temp; ";


sqlResult = db.executeQuery("DB", sql);
if (sqlResult == null) {
    eio.appendString8("F");
    es.logWarning("数据库执行错误, sql=" + sql);
    return;
}

eio.appendString8("T");
eio.appendDataSet(sqlResult,"c_date,gas_name,ship_count,retrun_count,reject_count,confirm_count,n1,n2",0,1000);

